    # Filling out the data search form
    def start_requests(self):
        return [FormRequest(url='http://www.tauntondeeds.com/Searches/ImageSearch.aspx',
                            formdata=self.formdata)]

    # Processing the POST request for go to the following pages
    def next_page(self, response):
        self.formdata['__EVENTARGUMENT'] = response.meta['item']
        yield FormRequest(url='http://www.tauntondeeds.com/Searches/ImageSearch.aspx',
                          formdata=self.formdata, callback=self.parse_table, dont_filter=True)

    # Parse count of the pages
    def parse(self, response):
        self.formdata['__EVENTTARGET'] = 'ctl00$cphMainContent$gvSearchResults'
        self.formdata.pop('ctl00$cphMainContent$btnSearchLC')

        for page in response.xpath('//table[@class="grid"]//tr[@class="gridPager"][1]//table//td//text()').extract():
            page_number = 'Page$' + page
            yield Request('https://www.tauntondeeds.com', method='POST',
                          meta={'item': page_number},
                          dont_filter=True, callback=self.next_page)

    # Parse data
    def parse_table(self, response):
        data = ItemLoader(item=ParsetauntondeedsItem(), response=response)

        data.add_xpath('date', '//table[@class="grid"]//tr[@onmouseout="this.className=this.originalClass;"]/'
                               'td[2]/text()')
        data.add_xpath('type', '//table[@class="grid"]//tr[@onmouseout="this.className=this.originalClass;"]/'
                               'td[3]/text()')
        data.add_xpath('book', '//table[@class="grid"]//tr[@onmouseout="this.className=this.originalClass;"]/'
                               'td[4]/text()')
        data.add_xpath('page_num', '//table[@class="grid"]//tr[@onmouseout="this.className=this.originalClass;"]/'
                                   'td[5]/text()')
        data.add_xpath('doc_num', '//table[@class="grid"]//tr[@onmouseout="this.className=this.originalClass;"]/'
                                  'td[6]/text()')
        data.add_xpath('city', '//table[@class="grid"]//tr[@onmouseout="this.className=this.originalClass;"]/'
                               'td[7]/text()')
        data.add_xpath('description', '//table[@class="grid"]//tr[@onmouseout="this.className=this.originalClass;"]/'
                                      'td[8]/span/text()')
        data.add_value('cost', parse_functions.get_cost(data.get_output_value('description')), MapCompose(float))
        data.add_value('street_address', parse_functions.get_street_address(data.get_output_value('description')))
        data.add_value('state', parse_functions.get_state(data.get_output_value('description')))
        data.add_value('zip', parse_functions.get_zip(data.get_output_value('description')))

        return data.load_item()
